import { ClassNames } from "@emotion/react";
import HeaderComponent from "../../components/header/Header";
import React from "react";
import { FoodContainer } from "../../components/foodcontainer/foodContainer.tsx";
import Outback from '../../components/imgs/restaurants/outback.webp';
import KFC from '../../components/imgs/restaurants/kfc.webp';
import PizzaHut from '../../components/imgs/restaurants/pizzahut.webp';
import HardRock from '../../components/imgs/restaurants/hardhock.webp';


function Home(){
    return (
        <div className="app">
                    <h1>Populars</h1>
        <HeaderComponent />

        <div className="food-displayer">
        <FoodContainer
        image={Outback} 
        children="Outback">
        </FoodContainer>

        <FoodContainer
        image={KFC} 
        children="KFC">
        </FoodContainer>

        <FoodContainer
        image={PizzaHut} 
        children="Pizza Hut">
        </FoodContainer>

        <FoodContainer
        image={HardRock} 
        children="Hard Rock">
        </FoodContainer>
        </div>
        </div>
    )
}

export default Home;
